import React from 'react';
import BasicTable from "./table.jsx";

class Player extends React.Component {
    constructor(props) {
        super(props);
        this.state ={
            tableHeaders: ['name', 'date', 'time'],
            tableData: [{name: 'tzach', date: '12/11/2020', time: '12:30'},
                {name: 'tzach', date: '12/11/2020', time: '12:30'}],
        }
    }
    componentDidMount() {
        this.getRecords();
    }

    async getRecords() {
        try {
            const res = await fetch('http://localhost:3000/test_db/getRecords', {
                // const res = await fetch('http://localhost:5000/test_db/saveRecord', {
                method: 'get',
                headers: {'Content-Type': 'application/json'}
            })
            if (res && res === 200) {
                console.log("Saved to DB");
            } else {
                console.error('Failed to save ');
            }
        } catch (ex) {
            console.log(ex)
        }
    }

    render() {
        return (
            <div>
                <BasicTable
                    tableHeaders={this.state.tableHeaders || []}
                    tableData={this.state.tableData || []}
                />
            </div>
        );
    }
}
export default Player;
